import React from 'react';
import {BrowserRouter as Router, Link} from "react-router-dom";

const header = (props) => {
    let accountLogin = null;
    let logoutRegister = null;

    if(props.isAuthenticated) {
        accountLogin = <Link className="nav-link" to="/account">Account</Link>
        logoutRegister = <Link className="nav-link" to="/" onClick={props.logout}>Logout</Link>
    } else {
        accountLogin = <Link className="nav-link" to="/register">Register</Link>
        logoutRegister = <Link className="nav-link" to="/login">Login</Link>
    }
    return (
        <div className="header mb-5">
            <nav className="navbar navbar-expand-lg navbar navbar-dark bg-dark">
                <a className="navbar-brand" href="#">CheckYourCar</a>
                <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>
                <div className="collapse navbar-collapse" id="navbarNav">
                    <ul className="navbar-nav mr-auto">
                    <li className="nav-item active">
                        <Link className="nav-link" to="/">Home</Link>
                    </li>
                    <li className="nav-item active">
                        {accountLogin}
                    </li>
                    <li className="nav-item active">
                        {logoutRegister}
                    </li>
                    </ul>
                </div>
            </nav>
        </div>
    );
};

export default header;
